import React from 'react'
import PropTypes from 'prop-types'
import { withRouter } from 'react-router'

import Garment from 'components/Garment'
import AddGarmentToCapsuleForm from './AddGarmentToCapsuleForm'

export class CapsuleEditorClosetGarment extends React.Component {
  static propTypes = {
    garment: PropTypes.object,
    image: PropTypes.object
  }

  render () {
    return (
      <div className='col-xs-12 col-sm-6 col-md-3 col-lg-2'>
        <Garment
          garment={this.props.garment}
          image={this.props.image}>
          <AddGarmentToCapsuleForm
            capsuleID={this.props.match.params.id}
            garmentID={this.props.garment.id} />
        </Garment>
      </div>
    )
  }
}

export default withRouter(CapsuleEditorClosetGarment)
